BEGIN TRANSACTION;
DROP TABLE IF EXISTS "Person";
CREATE TABLE IF NOT EXISTS "Person" (
	"Id"	TEXT NOT NULL,
	"FirstName"	TEXT,
	"LastName"	TEXT,
	"Tel"	TEXT,
	"Email"	TEXT,
	"IsRef"	INTEGER NOT NULL,
	CONSTRAINT "PK_Person" PRIMARY KEY("Id")
);
DROP TABLE IF EXISTS "Pitch";
CREATE TABLE IF NOT EXISTS "Pitch" (
	"Id"	TEXT NOT NULL,
	"Name"	TEXT,
	"DisplayOrder"	INTEGER NOT NULL,
	CONSTRAINT "PK_Pitch" PRIMARY KEY("Id")
);
DROP TABLE IF EXISTS "Team";
CREATE TABLE IF NOT EXISTS "Team" (
	"Id"	TEXT NOT NULL,
	"Name"	TEXT NOT NULL,
	"AgeGroup"	INTEGER NOT NULL,
	"Gender"	INTEGER NOT NULL,
	"League"	INTEGER NOT NULL,
	"Division"	INTEGER NOT NULL,
	"FullTimeTeamId"	TEXT,
	"FullTimeLeagueId"	TEXT,
	"RefRequired"	INTEGER NOT NULL,
	CONSTRAINT "PK_Team" PRIMARY KEY("Id")
);
DROP TABLE IF EXISTS "Fixture";
CREATE TABLE IF NOT EXISTS "Fixture" (
	"Id"	TEXT NOT NULL,
	"TeamId"	TEXT NOT NULL,
	"Date"	TEXT NOT NULL,
	"IsHome"	INTEGER NOT NULL,
	"Opponent"	TEXT,
	"FixtureType"	INTEGER NOT NULL,
	CONSTRAINT "FK_Fixture_Team_TeamId" FOREIGN KEY("TeamId") REFERENCES "Team"("Id") ON DELETE CASCADE,
	CONSTRAINT "PK_Fixture" PRIMARY KEY("Id")
);
DROP TABLE IF EXISTS "TeamContact";
CREATE TABLE IF NOT EXISTS "TeamContact" (
	"Id"	TEXT NOT NULL,
	"PersonId"	TEXT NOT NULL,
	"TeamId"	TEXT NOT NULL,
	"ContactType"	INTEGER NOT NULL,
	CONSTRAINT "FK_TeamContact_Team_TeamId" FOREIGN KEY("TeamId") REFERENCES "Team"("Id") ON DELETE CASCADE,
	CONSTRAINT "FK_TeamContact_Person_PersonId" FOREIGN KEY("PersonId") REFERENCES "Person"("Id") ON DELETE CASCADE,
	CONSTRAINT "PK_TeamContact" PRIMARY KEY("Id")
);
DROP TABLE IF EXISTS "Booking";
CREATE TABLE IF NOT EXISTS "Booking" (
	"Id"	TEXT NOT NULL,
	"Title"	TEXT,
	"Start"	TEXT NOT NULL,
	"End"	TEXT NOT NULL,
	"PitchId"	TEXT NOT NULL,
	"IsRecurring"	INTEGER NOT NULL,
	CONSTRAINT "PK_Booking" PRIMARY KEY("Id")
);
DROP TABLE IF EXISTS "FixtureAlloctation";
CREATE TABLE IF NOT EXISTS "FixtureAlloctation" (
	"Id"	TEXT NOT NULL,
	"FixtureId"	TEXT NOT NULL,
	"PitchId"	TEXT,
	"RefereeId"	TEXT,
	"Start"	TEXT NOT NULL,
	"Duration"	TEXT NOT NULL,
	"IsConfirmed"	INTEGER,
	CONSTRAINT "FK_FixtureAlloctation_Fixture_FixtureId" FOREIGN KEY("FixtureId") REFERENCES "Fixture"("Id") ON DELETE CASCADE,
	CONSTRAINT "FK_FixtureAlloctation_Pitch_PitchId" FOREIGN KEY("PitchId") REFERENCES "Pitch"("Id") ON DELETE RESTRICT,
	CONSTRAINT "FK_FixtureAlloctation_Person_RefereeId" FOREIGN KEY("RefereeId") REFERENCES "Person"("Id") ON DELETE RESTRICT,
	CONSTRAINT "PK_FixtureAlloctation" PRIMARY KEY("Id")
);
DROP INDEX IF EXISTS "IX_Fixture_TeamId";
CREATE INDEX IF NOT EXISTS "IX_Fixture_TeamId" ON "Fixture" (
	"TeamId"
);
DROP INDEX IF EXISTS "IX_TeamContact_PersonId";
CREATE INDEX IF NOT EXISTS "IX_TeamContact_PersonId" ON "TeamContact" (
	"PersonId"
);
DROP INDEX IF EXISTS "IX_TeamContact_TeamId";
CREATE INDEX IF NOT EXISTS "IX_TeamContact_TeamId" ON "TeamContact" (
	"TeamId"
);
DROP INDEX IF EXISTS "IX_FixtureAlloctation_FixtureId";
CREATE UNIQUE INDEX IF NOT EXISTS "IX_FixtureAlloctation_FixtureId" ON "FixtureAlloctation" (
	"FixtureId"
);
DROP INDEX IF EXISTS "IX_FixtureAlloctation_PitchId";
CREATE INDEX IF NOT EXISTS "IX_FixtureAlloctation_PitchId" ON "FixtureAlloctation" (
	"PitchId"
);
DROP INDEX IF EXISTS "IX_FixtureAlloctation_RefereeId";
CREATE INDEX IF NOT EXISTS "IX_FixtureAlloctation_RefereeId" ON "FixtureAlloctation" (
	"RefereeId"
);
COMMIT;
